import React, { Component } from "react";
import { connect } from "react-redux";
import { push } from "connected-react-router";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import styled from "styled-components";
import { fetchTrips, setSelectedTrip } from "../../actions/trips";
import {routes} from '../Router'

const ListWrapper = styled.form`

`;

class ListTripsPage extends Component {

  componentDidMount() {
    this.props.fetchTrips();
  }

  render() {

    return (
      <ListWrapper>
        {this.props.trips.map(trip => (
          <List>
            <ListItem>{trip.name}</ListItem>
            <Button onClick={this.props.goToTripDetailsPage}>Detalhes</Button>
          </List>
        ))}
      </ListWrapper>
    );
  }
}

function mapStateToProps(state) {
  return {
    trips: state.trips.trips
 };

}
const mapDispatchToProps = (dispatch) => ({
  fetchTrips: () => dispatch(fetchTrips()),
  goToTripDetailsPage:(tripId) => {
      dispatch(push(routes.tripsDetails)),
      dispatch(setSelectedTrip(tripId))
    }
  });


export default connect(
  mapStateToProps,
  mapDispatchToProps
)(ListTripsPage);
